import React from "react";
import DroneListItem from "./DroneListItem";
import FilterByDistance from "./FilterByDistance";

const ListComponent = ({droneData}) => {
    if (droneData.length > 0) {
        const result = Object.keys(droneData)
        .map(drone => {
            const index = droneData.findIndex(object => object.serialNumber === droneData[drone].serialNumber);

            if (index === -1) {
                droneData.push(droneData[drone]);
            }
        })
    }
    return(
        <ul>
            {Object.keys(droneData).map(drone => 
            <DroneListItem key={droneData[drone].serialNumber} droneData={droneData} drone={drone}/>
        )}
        </ul>
    )
};

export default ListComponent;
